import css from './TransactionHistory.module.css';
export const TransactionHistory = ({ transactions }) => {
  return (
    <table className={css.transactionHistory}>
      {transactions.map(item => {
        return <TransactionHead key={item.id} />;
      })}
    </table>
  );
};
